var binocu = binocu || {};
binocu.helpers = function () {
    var urlToSend = window.location.host;
    var siteName = function (url) {
        url = url.replace(new RegExp(/\/(.*)/), "");
        if (url.match(new RegExp(/\.[a-z]{2,3}\.[a-z]{2}$/i))) {
            url = url.replace(new RegExp(/\.[a-z]{2,3}\.[a-z]{2}$/i), "");
        } else if (url.match(new RegExp(/\.[a-z]{2,4}$/i))) {
            url = url.replace(new RegExp(/\.[a-z]{2,4}$/i), "");
        }
        if (url.indexOf('.') > 0) {
            url = url.split('.')
        }
        if (typeof url !== 'string') {
            url = url[url.length - 1];
        } else {
            url = url;
        }

        return url;
    }
    var siteDescription = function () {
        var descSelf = document.getElementsByTagName("title")[0].innerText.toLowerCase();
        var inSiteName = siteName(urlToSend);
        if (descSelf.indexOf(inSiteName) > 0) {
            descSelf = descSelf.replace(inSiteName, "");
        }
        return descSelf;
    }
    var runtimeOrExtension = chrome.runtime && chrome.runtime.sendMessage ?
        'runtime' : 'extension';
    var createHtml = function () {
        var allSect = document.createElement('section');
        allSect.id = 'mishchipu';
        allSect.charset = "utf-8";
        allSect.dir = 'ltr';
        allSect.innerHTML += '<i class="actionIcon"></i>';
        allSect.innerHTML += '<h6 class="title"></h6>';
        allSect.innerHTML += '<fieldset class="searchContainer"><label><input type="text" id="mishchipuInput" placeholder="New search" /><a href="javascript:void(0);" class="newSearch"></a><p class="similarWords"></p></fieldset>';
        allSect.innerHTML += '<article class="resultsContainer"></article><p class="powredComment"><span>Powered by:</span></p>';
        var newCss = document.createElement('style');
        var cssContent = cssMakeContent();
        newCss.type = 'text/css';
        newCss.innerHTML = cssContent;
        document.head.appendChild(newCss);
        document.body.appendChild(allSect);
        var actionButton = document.querySelector('#mishchipu .actionIcon');
        var searchButton = document.querySelector('#mishchipu .newSearch');
        var newSearchVal = document.querySelector('#mishchipu #mishchipuInput');
        actionButton.addEventListener("click", openAndCloseTray, false);
        searchButton.addEventListener("click", function () {
            var theValue = newSearchVal.value;
            if (theValue) {
                resultSearch(theValue)
            } else {
                newSearchVal.focus();
            };
        }, false);
    }
    var cssMakeContent = function () {
        var cssContent = '#mishchipu {direction: ltr;box-sizing: content-box;text-align:left;display:block;background: #059E9A;background: #DB3E3B;font-family: Arial, sans-serif;background: #F4F2ED;position:fixed;font-size:14px;top:0px;right:-260px;color:#585857;width:260px;bottom:0px;height:100%;border-left:4px solid #DB3E3B;z-index:100000000000;-webkit-transition:right linear 0.5s;transition:right linear 0.5s;}';
        cssContent += '#mishchipu * {direction:ltr;box-sizing: content-box;}'
        cssContent += '#mishchipu i.actionIcon {direction: ltr;display:block;position:absolute;top:50px;background:#DB3E3B;height:50px;width:50px;left:-50px;cursor:pointer;border-radius:4px 0px 0px 4px;}';
        cssContent += '#mishchipu i.actionIcon::before {content:"";display:block;position:absolute;height:34px;width:34px;border-radius:50%;top:8px;left:8px;box-shadow:inset 0px 1px 2px rgba(0,0,0,0.25);background-size: 22px 22px;background-repeat: no-repeat;background-position: center center;background-image:url(data:image/png;base64,);background-color:#fff;}'
        cssContent += '#mishchipu h6 {height:24px;width:260px;background-repeat:no-repeat;background-position:4px top;margin: 4px 0px;padding:8px;background-image: url(data:image/png;base64,);}'
        cssContent += '#mishchipu UL LI A {font-size:14px;color:#059E9A;display:block;font-size:14px;padding-bottom:4px;text-decoration:none;-webkit-transition:text-decoration linear 0.25s;transition:text-decoration linear 0.25s;}';
        cssContent += '#mishchipu UL LI A:hover {text-decoration:underline;background:transparent;color:inherit;}';
        cssContent += '#mishchipu fieldset {margin:0px;padding:0px;border:medium none;}'
        cssContent += '#mishchipu fieldset input[type="text"] {display:inline-block;border-radius:4px 0px 0px 4px;height:32px;width:180px;border:medium none;box-shadow:inset 1px 1px 2px rgba(0,0,0,0.25);margin:0px 0px 0px 10px;padding:0px 6px;}'
        cssContent += '#mishchipu fieldset input[type="text"]:focus {outline:0px;}';
        cssContent += '#mishchipu fieldset LABEL {display:block;margin:0px;padding:0px;}';
        cssContent += '#mishchipu fieldset LABEL > A {background: #059E9A;height: 32px;vertical-align: top;display: inline-block;width: 38px;position:relative;border-radius: 0px 4px 4px 0px;box-shadow: -1px 1px 2px rgba(0,0,0,0.25);}';
        cssContent += '#mishchipu fieldset LABEL > A:before {content: "";border: 2px solid #fff;height: 10px;width: 10px;background: transparent;position: absolute;border-radius: 50%;left: 10px;top: 6px;}';
        cssContent += '#mishchipu fieldset LABEL > A:after {content: "";position: absolute;height: 8px;width: 3px;background: #fff;border-radius: 1px;display: block;-webkit-transform: rotate(-45deg);bottom: 8px;right: 12px;}'
        cssContent += '#mishchipu fieldset LABEL > P {padding: 6px 0px;overflow: hidden;margin: 0px 14px;width: 210px;height: 16px;line-height: 18px;}'
        cssContent += '#mishchipu fieldset LABEL > P A {font-size:12px;text-decoration:none;color:#059E9A;}'
        cssContent += '#mishchipu UL LI A.resultSite {color:#F5A243;font-size:12px;}';
        cssContent += '#mishchipu .resultsContainer {position:absolute;left:0px;right:0px;bottom:28px;top:104px;width:100%;overflow:hidden;background:#fefefe;}';
        cssContent += '#mishchipu .powredComment {display: block;position: absolute;height: 28px;width: 260px;bottom: 0px;left: 0px;margin: 0px;padding: 0px;}';
        cssContent += '#mishchipu .powredComment span {color: #999;font-size: 12px;height: 24px;padding: 6px 52px 0px 14px;background-image: url(data:image/png;base64,);background-position: right center;background-repeat: no-repeat;display: inline-block;line-height: 16px;background-size: auto 66%;}';
        cssContent += '#mishchipu UL {padding:0px;margin:0px;overflow-y:auto;height:100%;overflow-x:hidden;opacity:0;-webkit-transition:opacity linear 0.25s;}';
        cssContent += '#mishchipu UL::-webkit-scrollbar-track {background:#eee;}';
        cssContent += '#mishchipu UL::-webkit-scrollbar {width:6px;background:#eee;}';
        cssContent += '#mishchipu UL::-webkit-scrollbar-thumb {background:#585857;}';
        cssContent += '#mishchipu UL LI {list-style:none;background: transparent;margin:0px;-webkit-transition:background-color linear 0.25s;transition:background-color linear 0.25s;padding:10px 16px;border-bottom:1px solid #f5f5f5;cursor:normal;}';
        cssContent += '#mishchipu UL LI.resultsTitle {background:#F4F2ED;font-size:16px;color:#DB3E3B;font-weight: bold;}'
        cssContent += '#mishchipu UL LI P {cursor: default;font-size:13px;margin:0px;padding:0px;}'
        cssContent += '@-webkit-keyframes venti { 0% {-webkit-transform:rotate(-7deg);} 35% {-webkit-transform:rotate(7deg);} 70% {-webkit-transform:rotate(-7deg);} 100% {-webkit-transform:rotate(-7deg);}}#mishchipu UL LI.noResult {text-align:center;font-size:16px;color:#DB3E3B;font-weight: bold;-webkit-animation: venti 2.5s linear infinite;border-bottom:medium none;}';
        cssContent += '#mishchipu UL LI.noResult:hover {background-color:transparent;}';
        cssContent += '#mishchipu UL LI.noResult:before {content:"";margin: 20px auto;display:block;width:140px;height:140px;background-image: url(data:image/png;base64,);}';
        cssContent += '#mishchipu LI:hover {background:#F4F2ED;}';
        cssContent += '@-webkit-keyframes orbit { 0% {-webkit-transform:rotate(0deg);} 50% {-webkit-transform:rotate(-180deg);} 100% {-webkit-transform:rotate(-360deg);}}#mishchipu .loader {height:200px;width:200px;background:transparent;border-radius:50%;-webkit-animation: orbit 2.5s linear infinite;margin:40px auto;position:relative;}#mishchipu .loader:before {content:"";display: block;position: absolute;background:url(data:image/png;base64,);left: 50px;background-size:100% 100%;top: -5px;height: 100px;width: 100px;}';
        return cssContent;
    }
    var openAndCloseTray = function () {
        var traySect = document.querySelector('#mishchipu');
        var sectRight = window.getComputedStyle(traySect)
        sectRight = parseInt(sectRight.getPropertyValue('right'));
        if (sectRight < 0) {
            traySect.style.right = '0px';
            var resultSect = document.querySelector('#mishchipu article');
            document.querySelector('#mishchipu #mishchipuInput').value = '';
            resultSearch()
            trySimWords();
        } else {
            traySect.style.right = '-260px';
        }
    }
    var trySimWords = function () {
        var te = '';
        var keywords = '';
        var metaWords = document.getElementsByTagName('meta');
        if (metaWords) {
            for (var x = 0, y = metaWords.length; x < y; x++) {
                if (metaWords[x].name.toLowerCase() == "keywords") {
                    keywords += metaWords[x].content;
                }
            }
        }
        if (keywords) {
            var keywordsArr = keywords.split(',');
            var keyWordsHtml = '';
            for (var i = 0; i < keywordsArr.length; i++) {
                keyWordsHtml += '<a href="javascript:void(0);" class="simiWord">' + keywordsArr[i] + ', </a>'
            }
            var similiarContainer = document.querySelector('#mishchipu .similarWords');
            similiarContainer.innerHTML = keyWordsHtml;
            var simiWord = document.getElementsByClassName("simiWord");
            for (var i = 0; i < simiWord.length; i++) {
                simiWord[i].addEventListener("click", function () {
                    var toSearchText = this.innerText;
                    var withOutComma = toSearchText.replace(/,/g, "");
                    var newSearchVal = document.querySelector('#mishchipu #mishchipuInput');
                    newSearchVal.value = withOutComma;
                    resultSearch(withOutComma);
                });
            }
        }
    }
    var resultSearch = function (searchWords) {
        var searchSection = document.querySelector('#mishchipu article');
        searchSection.innerHTML = '<div class="loader"></div>'
        setTimeout(function () {
            if (!searchWords) {
                searchWords = siteDescription();
                displayWords = 'Similar pages'
            } else {
                displayWords = searchWords;
            }
            searchWords = searchWords.replace(/[\/.,:-]+/g, " ").replace(/[\  ]+/g, " ");
            var searchLength = searchWords.split(" ");
            if (searchLength.length > 10) {
                searchWords = '';
                for (var i = 1; i < 6; i++) {
                    searchWords += searchLength[i] + ' ';
                }
            }
            var pageEncoding = document.charset.toLowerCase();
            if (pageEncoding !== 'utf-8') document.charset = document.charset = 'UTF-8';
            var xhr = new XMLHttpRequest();
            xhr.open("GET", 'http://ajax.googleapis.com/ajax/services/search/web?v=1.0&q=' + searchWords + '&rsz=8', false);
            xhr.send(null);
            var searchResultHtml = '';
            searchResultHtml += '<ul class="resultsList">';
            if (xhr.status == 200 && xhr.response) {
                var searchResultObj = JSON.parse(xhr.response);
                var searchResultRes = searchResultObj.responseData;
                var selfUrl = document.location.protocol + "//" + document.location.hostname + document.location.pathname;
                if (searchResultRes) {
                    searchResultHtml += '<li class="resultsTitle">Results for: ' + displayWords + '</li>'
                    if (searchResultRes.results.length > 1) {
                        for (var i = 0; i < searchResultRes.results.length; i++) {
                            if (selfUrl !== searchResultRes.results[i].url) {
                                searchResultHtml += '<li class="resultItem">';
                                searchResultHtml += '<a href="' + searchResultRes.results[i].url + '" class="resultTitle" target="_blank">' + searchResultRes.results[i].titleNoFormatting + '</a>'
                                searchResultHtml += '<a class="resultSite" href="' + searchResultRes.results[i].visibleUrl + '" target="_blank">' + searchResultRes.results[i].visibleUrl + '</a>'
                                searchResultHtml += '<p class="resultDescription">' + searchResultRes.results[i].content + '</p>';
                                searchResultHtml += '</li>';
                            }
                        }
                    } else {
                        searchResultHtml += '<li class="noResult">Sorry, but I found nothing</li>';
                    }
                } else {
                    searchResultHtml += '<li class="noResult">Sorry, but I\'ve unknown error</li>';
                }
            } else {
                searchResultHtml += '<li class="noResult">Sorry, but I\'ve unknown error</li>';
            }
            searchResultHtml += '</ul>';
            searchSection.innerHTML = searchResultHtml;
            document.querySelector('#mishchipu article ul').style.opacity = 1;
        }, 1000);
    }
    return {
        createHtml: createHtml
    }
}
var binocuObject = new binocu.helpers();
var checkIfShowMishchi = true;
var runtimeOrExtension = chrome.runtime && chrome.runtime.sendMessage ?
    'runtime' : 'extension';
chrome[runtimeOrExtension].sendMessage({
    checkIf: 'checkStatus'
}, function (response) {
    checkIfShowMishchi = response.answerIf;
    waitToRes(checkIfShowMishchi)
});
function waitToRes(checkIfShowMishchi) {
    if (checkIfShowMishchi == 'true') {
        binocuObject.createHtml()
    } else {
    }
}

